import React from "react";

export default function Card(props) {
  const { event } = props;
  return (
    <article className="event">
      <figure className="img-container">
        <img src={event.image} alt={event.name} />
      </figure>
      <div className="cocktail-footer">
        <h3>{event.name}</h3>
        <span>
          <b>Date:</b>
          {event.date}
        </span>
        <span>
          <p>Time:</p>
          {event.time}
        </span>
      </div>
    </article>
  );
}
